Hoe de zuurstofmeting in het bloed uitvoeren:
1. Draag het horloge een vingerbreedte onder het polsbeen en draag het in een comfortabele positie om de pols; 
2. Na het invoeren van de bloedzuurstofdetectiemodus, blijf alsjeblieft stil, zorg ervoor dat je pols plat is en het horloge naar boven wijst. Als je zit, kun je je armen op tafel leggen met je horloge naar boven gericht; 
3. Houd uw arm stil totdat u het eindresultaat krijgt.
